import {
  LineChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Line,
  Tooltip,
  Legend,
} from "recharts";

const VariablesGraph = (props) => {
  const data = props.hourly.time.map((x, index) => ({ x, y:props.hourly.windspeed_80m [index] }))
  console.log(props.variables.hourly);
  return (
    <LineChart width={600} height={600} data={data}>
      <XAxis dataKey="x" />
      <YAxis dataKey="y"/>
      <CartesianGrid stroke="#ccc" />
      <Line type="monotone" dataKey="windspeed_80m" stroke="#8884d8" />
      <Tooltip />
      <Legend />
    </LineChart>
  );
};

export default VariablesGraph;
